import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../assets/navbar.css";

export default function Header() {
  const [activeButton, setActiveButton] = useState("Home");
  const navigate = useNavigate();

  function handleDiscoverClick() {
    setActiveButton("Discover", () => {
      navigate("/discover");
    });
  }

  return (
    <nav className="navbar">
      <button
        className={`abutton ${activeButton === "Home" ? "active" : ""}`}
        onClick={() => {
          setActiveButton("Home", () => {
            navigate("/");
          });
        }}
      >
        <Link to="/">Home</Link>
      </button>
      <button
        className={`abutton ${activeButton === "Discover" ? "active" : ""}`}
        onClick={() => {
          setActiveButton("Discover", () => {
            navigate("/discover");
          });
        }}
      >
        <Link to="/discover">Discover</Link>
      </button>
      <button
        className={`abutton ${activeButton === "Profile" ? "active" : ""}`}
        onClick={() => {
          setActiveButton("Profile", () => {
            navigate("/profile");
          });
        }}
      >
        <Link to="/profile">Profile</Link>
      </button>
      <button id="createpost" className="abutton">
        <Link to="/createpost">Create Post</Link>
      </button>
      <button id="login" className="abutton">
        <Link to="/login">Login</Link>
      </button>
    </nav>
  );
}
